INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 582, 0, 0, 2, 0, "", "今日の運勢は大吉！　お出かけするといいことあるかも？　　　　また一緒に、お忍びデートしてくださいね……騎士♪", "", 60005, 0, 2);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 583, 0, 0, 2, 0, "", "今日の運勢は大吉！　転居するならあたたかい場所が吉！　　　　煉獄の世なれど、住めば都と申しんす。ゆるりときなんせ……♪", "", 60005, 0, 2);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 584, 0, 0, 1, 0, "", "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", "", 60005, 0, 3);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 585, 0, 0, 1, 0, "", "今日の運勢は中吉！　誰かに尽くすことで掴める幸せもあるかも？\n人事を尽くして天命を待つ！　さ、年始もバリバリ働きますわよ♪", "", 60005, 0, 3);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 586, 0, 0, 1, 0, "", "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？", "", 60005, 0, 3);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 587, 0, 0, 1, 0, "", "今日の運勢は中吉！　健康に気を遣って気持ちのいい一年を！\n体に不調があるときは遠慮なく言いなさい、隅々まで調べてあげる", "", 60005, 0, 3);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 588, 0, 0, 1, 0, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", "", 60005, 0, 3);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 589, 0, 0, 2, 0, "", "今日の運勢は中吉！　争いごとは勝つが油断は大敵！　　　　　　ま、このあたしと一緒なら、向かうところ敵はねーですよっ！", "", 60005, 0, 3);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 590, 0, 0, 2, 0, "", "今日の運勢は中吉！　ラッキーアイテムは「光るもの」！　　　　ハツネちゃんの「きらーんっ☆」な魔法、見せちゃおうかなっ？", "", 60005, 0, 3);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 591, 0, 0, 1, 0, "", "今日の運勢は小吉！　のんびり穏やかな一日となるでしょう！　　あなた様を邪魔するものは全てエリコが排除しますわ、クスクス♪", "", 60005, 0, 4);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 592, 0, 0, 1, 0, "", "今日の運勢は小吉！　小さな勇気で踏み出す一歩が大事！\n遠くから見てるだけじゃダメ。今日は、少しだけ近づいてみます！", "", 60005, 0, 4);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 593, 0, 0, 1, 0, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", "", 60005, 0, 4);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 594, 0, 0, 1, 0, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", "", 60005, 0, 4);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 595, 0, 0, 1, 0, "", "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", "", 60005, 0, 4);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 596, 0, 0, 2, 0, "", "今日の運勢は小吉！　空を眺めると気持ちが晴れやかに！　　　　眺めるだけじゃなくて、ひとっ飛びしちゃいましょうかっ♪", "", 60005, 0, 4);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 597, 0, 0, 2, 0, "", "今日の運勢は小吉！　掃除をすると運勢が開けそう！　　　　　　「わ、めんど」「ヴルムっ！　新年早々サボっちゃダメなんだからね！」", "", 60005, 0, 4);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 598, 190804, 0, 0, 0, "", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "カリン", 60005, 2, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 599, 190804, 7, 0, 0, "", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "カリン", 60005, 3, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 600, 190804, 0, 1, 0, "", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "カリン", 60006, 1, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 601, 0, 0, 2, 0, "", "今日の運勢は姫吉！　勇気を持って、新しいことに挑戦しよう！\n幸先がいいねえ少年！　今年もいい一年になるよう祈ってるよ。", "", 60006, 0, 1);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 602, 0, 0, 2, 0, "", "今日の運勢は姫吉！　どんなピンチも簡単に乗り越えられそう！\nよい結果が出たようで何よりです。さて、待人の方は……ふふ。", "", 60006, 0, 1);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 603, 0, 0, 2, 0, "", "今日の運勢は姫吉！　あの人と仲直り……できちゃうかも！？\nはあ……この私があなたの運勢に興味を抱くわけないでしょう？", "", 60006, 0, 1);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 604, 0, 0, 1, 0, "", "今日の運勢は大吉！　身近な友達との絆が深まる予感……？\n騎士様は、どなたと友誼を結ぶのでしょう？　気になります……", "", 60006, 0, 2);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 605, 0, 0, 2, 0, "", "今日の運勢は大吉！　ラッキーアイテムは「蛇の抜け殻」！\nこのアタシにお目にかかれるなんて……アンタ、幸せものね♪", "", 60006, 0, 2);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 606, 0, 0, 2, 0, "", "今日の運勢は中吉！　気になるあの人に会えちゃうかも！？\n『初夢を正夢にする枕』であなたに会え……な、なんでもない！", "", 60006, 0, 3);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 607, 0, 0, 2, 0, "", "今日の運勢は中吉！　子供に戻って、一日中遊びつくそう！\nお年玉でけん玉ゲット！　おじちゃん、もしかめ一万回やって！", "", 60006, 0, 3);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 608, 0, 0, 1, 0, "", "今日の運勢は中吉！　今日はおうちで、ゆーっくりくつろごう。\nお雑煮よし。みかんよし。さ、こたつで寝正月だ。君も入る？", "", 60006, 0, 3);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 609, 0, 0, 2, 0, "", "今日の運勢は小吉！　突然のドッキリに注意！\nおや、後ろに髪の長い女の霊が──フフ、冗談です。私ですよ。", "", 60006, 0, 4);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 610, 0, 0, 2, 0, "", "今日の運勢は小吉。慌てなくても、幸運はきっとやってくる。\n運は自分で掴むもの──媛が言ってました。でも、どうやって？", "", 60006, 0, 4);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 611, 190804, 0, 0, 0, "", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "カリン", 60006, 2, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (3, 612, 190804, 5, 0, 0, "", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "カリン", 60006, 3, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (1, 613, 190804, 0, 1, 0, "", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "カリン", 60007, 1, 0);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 614, 0, 0, 2, 0, "", "今日の運勢は姫吉！　絶好調で最高の一日になりそう♪\nわたしも、騎士クンが一緒ならいつだって最高に幸せな日だよ……", "", 60007, 0, 1);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 615, 0, 0, 2, 0, "", "今日の運勢は姫吉！　新しいことに挑戦するチャンス！\nお姉さんも一緒に挑戦しちゃおっかな♪　飲み処の新規開拓とか！", "", 60007, 0, 1);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 616, 0, 0, 2, 0, "", "今日の運勢は姫吉！　日々の努力が実を結ぶ予感！\n今日一日鍛錬に勤しむべき、ということだな。では早速行こうか。", "", 60007, 0, 1);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 617, 0, 0, 2, 0, "", "今日の運勢は大吉！　家族サービスにはぴったりの日！\nさっそく弟くんにあまあまお姉ちゃんの出血大サービス、だよっ♪", "", 60007, 0, 2);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 618, 0, 0, 2, 0, "", "今日の運勢は大吉！　笑顔で過ごせば周りもみんなハッピーかも！\n『笑う顔はフグになる』ですねっ。幸せいっぱいお届けしますっ", "", 60007, 0, 2);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 619, 0, 0, 2, 0, "", "今日の運勢は中吉！　恋愛運良し、積極的な行動に成果が！？\nじゃあ騎士さんのこと、拉致しちゃうとか★　恋愛成就確定です♥", "", 60007, 0, 3);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 620, 0, 0, 2, 0, "", "今日の運勢は中吉！　おめかししたら運気も上昇？\n毛並がふわふわになるまでブラッシングしたわ♪　ふふ、完璧ね！", "", 60007, 0, 3);
INSERT INTO `v1_dbec48171f2af8f5b431049bbb2053695207d52fa81a4e8a0d181393a558ab3f` VALUES (2, 621, 0, 0, 2, 0, "", "今日の運勢は小吉！　知らない場所に行くと新たな発見が！\n未知の場所……一人では恐ろしくて。騎士さま、どうかお力添えを", "", 60007, 0, 4);
